		function drawBarChart(context, data, startX, startY, barWidth, chartHeight, markDataIncrementsIn)
		{
			// Draw the x and y axes
			context.font = '180% chalkFont';
			context.lineWidth = "2.0";
			//drawLine(context, startX, startY, startX, startY + chartHeight); 
			//drawLine(context, startX, startY, 570, startY);			
			context.lineWidth = "0.0";
			var maxValue = 0;
			for (var i=0; i < data.length; i++) {
				// Extract the data
				var values = ["1st", "2nd", "3rd", "4th", "5th", "6th"]
				var name = values[i];
				var height = parseInt(data[i]);
				if (parseInt(height) > parseInt(maxValue)) maxValue = height;
	
				// Write the data to the chart
				context.fillStyle = "#fff";
				drawRectangle(context, startX + (i * barWidth) + i, (startY - chartHeight - height), barWidth, height, true);
	
				// Add the column title to the x-axis
				context.textAlign = "left";
				context.fillStyle = "#fff";
				context.fillText(name, startX + (i * barWidth) + i, startY - chartHeight + 20, 200);		
			}	
			// Add some data markers to the y-axis
			var numMarkers = Math.ceil(maxValue / markDataIncrementsIn);
			context.textAlign = "right";
			var markerValue = 0;
			for (var i=0; i < numMarkers; i++) {		
				context.fillText(markerValue, (startX - 5), (startY - chartHeight - markerValue), 50);
				markerValue += markDataIncrementsIn;
			}
		}
		
		function drawLine(contextO, startx, starty, endx, endy) {
			contextO.beginPath();
			contextO.moveTo(startx, starty);
			contextO.lineTo(endx, endy);
			contextO.closePath();
			contextO.stroke();
		}

// drawRectangle - draws a rectangle on a canvas context using the dimensions specified
		function drawRectangle(contextO, x, y, w, h, fill) {			
			contextO.beginPath();
			contextO.rect(x, y, w, h);
			contextO.closePath();
			contextO.stroke();
			if (fill) contextO.fill();
		}
		
